// src/components/ClientHome.js
import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
//import './ClientHome.css'; // Add any specific styling here

const ClientHome = () => {
    const [devices, setDevices] = useState([]);
    const [error, setError] = useState(null);

    useEffect(() => {
        const fetchDevices = async () => {
            try {
                const response = await fetch('http://localhost:8081/devices/user-devices'); // Adjust endpoint if needed
                if (!response.ok) {
                    throw new Error('Failed to fetch devices');
                }
                const data = await response.json();
                setDevices(data);
            } catch (err) {
                setError(err.message);
            }
        };

        fetchDevices();
    }, []);

    return (
        <div>
            <h2>Welcome, Client</h2>
            <h3>Your Devices</h3>
            {devices.length > 0 ? (
                <ul>
                    {devices.map((device) => (
                        <li key={device.id}>{device.description}</li>
                    ))}
                </ul>
            ) : (
                <div>No devices found.</div>
            )}
        </div>
    );
};

export default ClientHome;
